import React from "react";
import CloudImg from './amicloud.jpg'



const Home = () => {
    return (
        <div className="content">
        <div className="Home">
          <h1 className="welcome">Welcome to Craft Cloud!</h1>

          <img src={CloudImg} alt="a crafted cloud" />
          <h2>
          Unleash your creativity and keep it neatly organized with our crafting ideas sanctuary!
          </h2>
        </div>
      </div>
    );
  };

  export default Home;
